export function mediaReducer(state = initialState, action = {}) {
    switch (action.type) {
        case 'SET_MEDIA_LINK':
            console.log('reducer1',state.mediaLink);
            console.log('reducer2',action.mediaLink);
                return { ...state, mediaLink: action.mediaLink
            };
